import React from 'react'

const Navbar = () => {
  return (
    <div className='w-full h-2 '>
        <ul className='list-none flex'>
            <li>Products</li>
            <li>Offers</li>
            <li>Contact</li>
        </ul>

    </div>
  )
}

export default Navbar
